import React,  { useEffect, useState } from 'react'
import {Link, useParams} from 'react-router-dom'
import './adminprofile.css';
import StudentHeading from '../../common/heading/studentheading/StudentHeading.jsx'
import axios from 'axios';

const AdminProfile = () => {
    const { email } = useParams();
    const [adminData, setAdminData] = useState([]);

    useEffect(() => {
        fetchData();
      }, []);

    const fetchData = async () => {
    try {
        const adminDetails = await axios.get('http://localhost:8081/admin/'+email);
        setAdminData(adminDetails.data);
    } catch (error) {
        console.error('Error fetching data:', error);
    }
    };

    return(
        <>
            <StudentHeading/>
            <div class='profile-banner'>
                <div class='profile-image'></div>
                <div class='profile-heading'>
                {adminData.map((student, index) => (
                    <p class='profile-title-1'>{admin.institute}</p>
                ))}
                </div>
            </div>
            <div class='student-profile-details'>
                    <div class='student-about'>
                        <p class='profile-title'>About</p>
                        <div class='profile-section-rect'>
                            <div className='profile-about-content'>
                                <p>Mail ID:</p>
                                <p>Phone number:</p>
                                <p>CGPA:</p>
                                <p>Semester:</p>
                                <p>Section:</p>
                            </div>
                        </div>
                    </div>
                    <div class='student-about'>
                        <p class='profile-title'>Club Membership</p>
                        <div class='profile-section-rect'>
                            <form class>
                                <label for='club-member'>Club name:</label>
                                <input type='text'></input><br></br><br></br>
                                <label for='designation'>Designation:</label>
                                <input type='text' defaultValue={'Member'}></input><br></br><br></br>
                                <label for='joining-date'>Date of joining:</label>
                                <input type='date'></input>
                            </form>
                        </div>
                    </div>
            </div>
        </>
    )
}

export default AdminProfile
